function loadFavouritesGallery(selector){getFavourites().then(function(favourites){if(!favourites.length){$(selector).html("<p>You haven't added any favourite tasks</p>");}else{let galleryItems=favourites.map(function(task){return getGalleryItem(task);}).join("");$(selector).html(galleryItems);$(selector).lightGallery();$(selector).justifiedGallery();}});}
function getFavourites(){return new Promise(function(resolve,reject){$.ajax({url:"/api/favorites",contentType:"application/json",dataType:"json",type:"GET"}).done(function(results){resolve(results);}).fail(function(xhr,status,error){reject(new Error(`Failed to add favourite task:status`));});});}
function addFavourite(taskId){return new Promise(function(resolve,reject){$.ajax({url:'/api/favorites',contentType:"application/json",data:JSON.stringify({task_id:taskId}),dataType:'json',type:'POST'}).done(function(){resolve(true);}).fail(function(xhr,status,error){reject(new Error(`Failed to add favourite task:status`));});});}
function removeFavourite(taskId){return new Promise(function(resolve,reject){$.ajax({url:`/api/favorites/${taskId}`,contentType:"application/json",dataType:'json',type:'DELETE'}).done(function(){resolve(false);}).fail(function(xhr,status,error){reject(new Error(`Failed to remove favourite task:status`));});});}
function isFavourite(taskId){return new Promise(function(resolve,reject){getFavourites(taskId).then(function(favourites){for(let i=0;i<favourites.length;i++){if(favourites[i].id==taskId){resolve(true);}}
resolve(false);}).catch(function(error){reject(error);});});}
function updateFavouritesButton(btn,isFavourite){let text=isFavourite?"Remove from Favourites":"Add to Favourites",icon=isFavourite?"fa-thumbs-down":"fa-thumbs-up",html=`<span class="fa ${icon} mr-1"></span>${text}`;btn.html(html);}
function toggleFavouriteTask(taskId){return new Promise(function(resolve,reject){isFavourite(taskId).then(function(isFav){if(isFav){return removeFavourite(taskId);}
return addFavourite(taskId);}).then(function(isFav){resolve(isFav);});});}
function getFavouritesButton(taskId){return new Promise(function(resolve,reject){isFavourite(taskId).then(function(isFav){let btn=$(`<button class="btn btn-info btn-favourites"type="button"
role="button"data-task-id="${taskId}"/>`);updateFavouritesButton(btn,isFav);resolve(btn);});});}
$('body').on('click','.btn-favourites',function(){let btn=$(this),taskId=btn.data('task-id');toggleFavouriteTask(taskId).then(function(result){updateFavouritesButton(btn,result);if(result){notify(`Task added to your favourites.`,'success');}else{notify(`Task removed from your favourites.`,'success');}}).catch(function(err){throw err;});});if($('.favourites-gallery').length){loadFavouritesGallery('.favourites-gallery');}